import React from "react";
import Dialog from "./Dialog";

export default function Login() {
  return (
    <div style={{ position: "relative" }}>
      <div
        style={{ backgroundColor: "green", height: "280px", width: "100%" }}
      ></div>
      <div
        style={{ marginTop: "185px", overflow: "hidden", position: "absolute" }}
      ></div>
      <Dialog />
    </div>
  );
}
